import React from "react";
const SlotM = ((props)=>{

    if((props.x===props.y) && (props.y===props.z)){
        return(
            <>
                <div className='slotentry'>
                    <h1>{props.x} {props.y} {props.z}</h1>
                    <h3>This is Matching </h3>
                </div>
            </>
        )
    }
    else{
        return(
            <>
                <div className='slotentry'>
                    <h1>{props.x} {props.y} {props.z}</h1>
                    <h3>This is not  Matching </h3>
                </div>
            </>
        )
    }
})
export default SlotM
